import React from 'react'
import Product from '../Product/Product'

const featProd = [
    {id: 1, name: 'Gold Chair1', descrip: 'This is a test description only for dev purposes.', price: '$25'},
    {id: 2, name: 'Gold Chair2', descrip: 'This is a test description only for dev purposes.', price: '$26'},
    {id: 3, name: 'Gold Chair3', descrip: 'This is a test description only for dev purposes.', price: '$27'},
    {id: 4, name: 'Gold Chair4', descrip: 'This is a test description only for dev purposes.', price: '$28'},
]

const FeaturedProduct = () => {
  return (
      <main>
        {featProd.map((product)=>(
            <div className="feat-prod-wrap" key={product.id}>
                <Product />
            </div>
        ))}
      </main>
  )
}

export default FeaturedProduct
